import React from 'react'
import styled from 'styled-components'
import { Margin16 } from '../component/styledComponent'

const Title = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 18px;
  color: #000000;
  text-align: left;
`
const Content = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 22px;
  text-align: left;
  color: #000000;
`

interface TermBoxProps {
  title: string
  content: string
}
export const TermBox = (props: TermBoxProps) => {
  const { title, content } = props
  return (
    <div>
      <div>
        <Title>{title}</Title>
      </div>
      <div>
        <Margin16 />
      </div>
      <div>
        <Content>{content}</Content>
      </div>
    </div>
  )
}
